import React from "react";
import "./Footer.css";
import images from "../../constant/images";
const Footer = () => {
  return (
    <div className="footer_main">
      <div>
        <img src={images.PlastaplogoRemovebg} className="plastaps_logo" />
      </div>
      <div className="store_btn">
        <p style={{ color: "#fff" }}>Download the app</p>
        <div style={{ display: "flex", gap: "10px", alignItems: "self-start" }}>
          <div>
            <a href="https://plastaps.com/" target="_blank">
              <img src={images.GPlaystore} style={{ height: "49px" }} />
            </a>
          </div>
          <div style={{ display: "flex", alignItems: "center" }}>
            <a href="https://plastaps.com/" target="_blank">
              <img src={images.AppStore} />
            </a>
          </div>
        </div>
        <br />
      </div>
      <hr />
      <div>
        {/* <br /> */}
        <p style={{ color: "#fff", display: "flex", justifyContent: "center" }}>
          Contact us
        </p>
      </div>
    </div>
  );
};

export default Footer;
